INSERT INTO `goldbook` VALUES (2,'2015-11-21 00:00:00','lufau daniele','jld.lufau@wanadoo.fr','charmante boutique , accueil chaleureux; prix raisonnable',1),(3,'2015-11-23 00:00:00','Claverie','claverie.marianne@gmail.com','Bonjour et bravo pour votre très joli site!\r\nLes photos sont fidèles à la réalité du produit et toujours un excellent rapport qualité prix ! ',1),(4,'2015-11-28 00:00:00','Fernandes Gwendoline','gwendoline.bazingette@gmail.com','Très jolie boutique et un acceuil toujours au top.\r\nDes produits féminins,tendances et de bonne qualité,on trouve toujours quelque chose pour faire plaisir ou se faire plaisir.',1),(5,'2015-11-29 00:00:00','Dv','virbeutis@hotmail.fr','Connue sur les marchés,  jamais déçue,  enfin une boutique en ligne!',1),(6,'2015-12-01 00:00:00','Lamri Gwénaëlle','gwenaelle.lamri@gmail.com','Bonjour, J\'ai bien reçu mon sautoir, très beau porduit ! Merci pour votre efficacité :). A bientôt Lamri Gwénaëlle',1),(7,'2015-12-12 00:00:00','Godrie','anna.godrie@gmail.com','Vos bijoux sont magnifiques je vous ai connu au marché de nerac (47) j\'attendais avec impatience votre retour dans le lot et garonne. Grâce a votre site je vais pouvoir le faire plaisir plus souvent. Surtout que j\'aime beaucoup le prénom louise je viens d\'avoir une fille qui s\'appelle louise également.',1),(8,'2015-12-20 00:00:00','mengarduque','cecilia.mengarduque@caissedesdepots.fr','Super le site ! Le style et les prix sont toujours au top !',1);
