INSERT INTO `news` VALUES (1,'2015-11-19 00:00:00','Les Secrets de Louise','www.lessecretsdelouise.com ','Sur la toile,\r\nLa petite Louise a la joie de vous annoncer l\'arrivée d\'un site internet, il se nomme \"Les Secrets de Louise\".\r\nIl pèse 3 bijoux, 4 colliers et beaucoup de secrets.\r\nIl fait la joie de toutes nos clientes.\r\nLe baptême a eu  lieu le jeudi 19 novembre 2015 au matin.\r\nNous attendons vos premiers clics avec impatience.\r\nMerci à tous.','/Louise-1.jpg',1),(2,'2015-12-07 00:00:00','VENTE PRIVEE ARCACHON','','LES SECRETS DE LOUISE - BOUTIQUE D\'ARCACHON\r\n26, avenue Gambetta - 33120 ARCACHON\r\nVENTE PRIVEE\r\nDes remises sur toute la boutique : Bijoux, Maroquinerie, Accessoires ...\r\nTombola gratuite : de nombreux lots à gagner dont une tablette tactile d\'une valeur de 200 euros...','/les_secrets_de_louise-2.jpg',1),(3,'2015-12-20 00:00:00','PLUS QUE QUELQUES JOURS POUR VOS CADEAUX','','Plus que quelques jours pour vos cadeaux de Noël !!\r\nNous traiterons vos commandes jusqu\'au 22 décembre pour une livraison le 24 décembre ...\r\nVite ... vite... vite !!','/ART000AAA006_4_-3.jpg',1);
