INSERT INTO `newsletter_detail` VALUES (349,13,'Louise','/Louise-13.jpg','http://lessecretsdelouise.com','Sur la toile,\r\nLa petite Louise a la joie de vous annoncer l\'arrivée d\'un site internet, il se nomme \"Les Secrets de Louise\". \r\nIl pèse 3 bijoux, 4 colliers et beaucoup de secrets. \r\nIl fait la joie de toutes nos clientes. \r\nLe baptème aura lieu \"jeudi 19 novembre 2015\" au matin. \r\nNous attendons vos premiers clicks avec impatience.\r\nMerci à tous.'),(350,14,'super promo de noel','/BO141(2)-.jpg','http://lessecretsdelouise.com','bla'),(351,14,'','/BO152-14.jpg','',''),(366,17,'','/Louise-17.jpg','','Sur la toile,\r\nLa petite Louise a la joie de vous annoncer l\'arrivée d\'un site internet, il se nomme \"Les Secrets de Louise\",\r\nIl pèse 3 bijoux, 4 colliers et beaucoup de secrets.\r\nIl fait la joie de toutes nos clientes.\r\nLe baptême a eu lieu le jeudi 19 novembre au matin.\r\nNous attendons vos premiers clics avec impatience.\r\nMerci à tous.'),(452,18,'NAISSANCE DU SITE ','/Louise18-18.jpg','http://www.lessecretsdelouise.com','Sur la toile,\r\nLa petite Louise a la joie de vous annoncer l\'arrivée d\'un site internet, il se nomme \"Les Secrets de Louise\",\r\nIl pèse 3 bijoux, 4 colliers et beaucoup de secrets.\r\nIl fait la joie de toutes nos clientes.\r\nLe baptême a eu lieu le jeudi 19 novembre 2015 au matin .\r\nNous attendons vos premiers clics avec impatience.\r\nMerci à tous.'),(453,18,'ENCORE QUELQUES JOURS POUR VOS CADEAUX DE FIN D\'ANNEE','/les_secrets_de_louise-18.jpg','http://www.lessecretsdelouise.com','Nous sommes à quelques boules de neige du Père Noël !\r\nNous vous espérons tous et toutes en pleine forme avant ces Fêtes ...\r\nNous vous présentons un large choix de Bijoux à prix très doux !\r\nCollection Fantaisie, Argent et plein de cadeaux à placer sous vos jolis sapins de Noël ...\r\nDes idées de cadeaux ... à offrir, à vous offrir ou à vous faire faire offrir !!!\r\n\r\nLa tendance de cette fin d\'année : boucles d\'oreilles et bracelets.\r\n\r\nBonnes Fêtes à tous !\r\n\r\n'),(454,18,'UNE HISTOIRE DE BOUCLES D\'OREILLES','/bc1117_5_-18.jpg','http://www.lessecretsdelouise.com/categories.php?idcat=44','Depuis plus de 10 ans, nous fabriquons dans notre atelier des bijoux : boucles d\'oreilles, bracelets, colliers, parures ...\r\nChristine, qui en est la créatrice, est partie du principe qu\'un bijoux fantaisie pouvait être beau, de belle facture et à prix doux... et fabriqué en petite quantité, un ou deux exemplaires, pour que chaque cliente ait son propre bijoux qu\'elle ne verra pas porter par une autre !\r\nC\'est pour cela que nous avons, sur notre site et dans nos boutiques, des milliers de boucles d\'oreilles différentes et en un seul exemplaire !\r\nNos fidèles clientes savent aussi nous commander leurs bijoux pour une occasion particulière ou simplement pour assortir avec la tenue qu\'elles viennent d\'acheter.\r\nNos bijoux sont fabriqués dans des matières nobles : perle de Bohême, nacre, hématite, pierre de lave, agathe, jaspe, argent (925 ou plaqué), bois, céramique ...');
